Что взять с собой в роддом в США 🤰Как я уже писала, можно вообще ничего не брать кроме карсита, но учтите, что в больнице вам дадут только вещи таких брендов как huggis, pampers, johnson’s baby и т.п., что имхо не лучший выбор для ребенка. 
Итак, мой список:
- 2-3 пижамки на молнии для малыша 2х размеров: newborn и 0-3 months, чтобы не прогадать с размером, шапочка, теплый комбинезон для выписки, если будет холодно;
-  1-2 пеленки или лучше специальный swaddle на липучках, Ди выбиралась из обычной пеленки за 2 секунды, поэтому swaddle от @happiest_baby - спасение для таких буйных малышей 😃;
- 1-2 пижамы для себя, носки, одежда для выписки;
- любимая уходовая косметика, я купила специально миниатюры, чтобы не тащить полный размер;
- тапочки (для палаты) и шлепки (для душа);
- если вы планируете ГВ, вам надо будет начать кормить уже в больнице, оч советую nipple butter от @earthmamaorganics и серебряные накладки @silveretteusa , т.к. поначалу это будет ОЧЕНЬ больно;
- diaper cream у меня тоже от @earthmamaorganics , это один из немногих брендов с натуральным составом и оч приятными запахами;
- @honest - еще один хороший бренд детских товаров, особенно советую шампунь/гель для тела и подгузники;
- влажные салфетки WaterWipes, больничные неприятно пахли 🙈;
- обязательно бальзам для губ и крем для рук, кожа сохнет безумно сильно после родов и частого мытья рук;
- nursing bras если планируете ГВ;
- перекус типа печенек, шоколада или фруктов, на случай если схватки начнутся ночью, и больничное кафе будет закрыто;
- @fridamom peri bottle (гораздо удобнее, чем больничная);
- полотенца для душа, т.к. больничные очень маленькие и тонкие;
- зарядка для телефона;
- беруши и маска для сна (на самом деле, это больше для вашего партнера, т.к. вас будут проверять и что-то спрашивать каждый час);
- disposable underwear, мне понравились always discreet, гораздо удобнее больничных, и размер S/M подошел идеально;
- резинка для волос;
- соска (не рекомендуется использовать в первые сутки, но после можно, чтобы малыш не использовал вашу грудь как соску).

Т.к. список получился довольно большой, пришлось брать небольшой чемодан и рюкзак 😅

