Умная кроватка SNOO за $1900, стоит ли она того? 

Пока сложно сказать, потому что Диана и так хорошо спит, при этом она наотрез отказывается засыпать в самой кроватке (обычно засыпает на груди или руках, и потом мы ее перекладываем) 🙈

В чем уникальность SNOO: 
- безопасность. Американская ассоциация педиатров настоятельно советует, чтобы дети с рождения спали на спине в своей кроватке (но в одной комнате с родителями в течение первых 6 месяцев) и чтобы она была абсолютно пустая: без одеял, подушек, игрушек, бортиков и т.д., только простынь на резинках (fitted sheet) и сам ребенок. Считается, что малыш может задохнуться из-за любых посторонних вещей + они повышают риск SIDS (синдром внезапной детской смерти). Спать во взрослой кровати с ребенком тоже крайне не рекомендуется, чтобы случайно его не задавить (к сожалению, очень много случаев, особенно в первый месяц из-за недосыпа);
- она считывает движения и плач малыша и сама укачивает его когда нужно, при этом ребенок в любом случае не уснет, если он голодный или у него что-то болит;
- встроенный белый шум и несколько скоростей движения (включая режим без движения), которые можно контролировать в приложении для телефона; 
- приложение также составляет ежедневный график о том как/сколько спал ребенок;
- ее можно использовать до 6 месяцев;
- новорожденные обычно спят в ней 2-4 часа подряд (или их надо будить самим на кормление), дети постарше - всю ночь;
- в набор входит специальный swaddle на застежках, чтобы ребенок сильно не шатался во время укачивания и не будил себя своими движениями;
- бортики сделаны из сетки, поэтому ребенок может спать непристегнутым как в обычной кроватке (функция укачивания доступна только, когда swaddle пристегнут), и это все равно будет безопасно, даже если он уткнется носом в стенку;
- красивый минималистичный дизайн;
- к ней продаются специальные ножки для создания небольшого наклона со стороны головы, это оч помогает детям с рефлюксом; 
- SNOO сейчас настолько популярны, что люди перепродают их с минимальной скидкой (аля $100-300). Наши друзья вообще продали ее дороже, чем купили, их кроватка уже была б/у 😅 

Продолжение в комментах 👇

Маст-хэвы для новорожденных помимо тех, что я уже упоминала в предыдущих постах 😊:
- @babybjorn bouncer или какательный стульчик 😂 Очень помогает ребенку прокакаться, извиняюсь за подробности 😅 Мы им пользуемся прям с рождения: раньше Диана на нем просто лежала/сидела, и где-то только в месяц-полтора начала играть с игрушками, которые к нему крепятся, ей очень нравится;
- подушка для кормления My Brest Friend (смотрите полные названия на скринах в карусели): мега удобная вещь, бережет спину и руки во время кормления, но она работает только пока ребенок оч маленький, Диана на нее перестала помещаться где-то в 1 месяц;
- ванночка @fridababy удобна тем, что ее можно поставить в/ или рядом с раковиной и купать малыша не наклоняясь. В ней также есть слив и регулируемое «сидение» для разных возрастов;
- Skip Hop changing pad (прастити, не знаю как это по-русски, короче штука для смены подгузников 🤪) просто the best: сделан из приятного материала, который всегда остается теплым и его можно сразу же протереть влажной салфеткой, если что-то протекло, а протекать оно будет часто 😅;
- урна для памперсов Ubbi: красивая и удобная, блокирует запахи;
- стерилизатор Avent (обязательно с функцией сушки, иначе он не имеет смысла): стерилизует и идеально сушит бутылочки и т.п. всего за 40 мин.

Также рекомендую подогреватель влажных салфеток (особенно выручал зимой, когда было холодно) и муслиновые пеленки/полотенца/салфетки - безумно приятная ткань на ощупь, как облако 🥰 

